    const [shoppingItems , setShoppingItems] = useState([]);

    useEffect(()=>{
        Axios.post("http://localhost:4000/myItems" , {
            user : getCookie('email') ,
        }).then(response =>{
            setShoppingItems(usefulCartData(response.data));
        }).catch(error =>{
            console.log(error);
        })
    } , [])

    console.log(shoppingItems);

    return(
        <div className = "grid grid-areas-cart-layout mx-10 my-10">
            <div className = "grid grid-in-cart bg-black h-3/6">

            </div>
        </div>
    );
}

export default Cart;
